#include <iostream>

using namespace std;

int main() {

	setlocale(LC_ALL, "ru");

	const int size = 40;
	int arr[size]  = { 2,3,6,5,2,3,4,1,7,3,4,5,2,3,4,1,2,3,4,5,8,3,4,1,2,3,4,5,7,3,4,1,2,3,4,5,2,6,4,1};

	int number;
	cout << "Введите номер квартиры (от 1 до 40): ";
	cin >> number;

	number--;

	cout << "В квартире проживает: " << arr[number] << " человек" << endl;

	if (number % 2 == 0) {
		cout << "В соседней квартире проживает: " << arr[number + 1] << " человек" << endl;
	}
	else {
		cout << "В соседней квартире проживает: " << arr[number - 1] << " человек" << endl;
	}
}

#include <iostream>

using namespace std;

int main() {
	const int size = 9;
	double arr[size] = { -5.7, 6.0, 2, 0, -4.7, 6, 8.1, -4, 0 };

	double positive = 0;
	for (int i = size - 1; i >= 0; i--) {
		if (arr[i] > 0) {
			positive = arr[i];
			break;
		}
	}

	double negative = 0;
	for (int i = 0; i < size; i++) {
		if (arr[i] < 0) {
			negative = arr[i];
			break;
		}
	}
	cout << "Last positive number: " << positive << endl;
	cout << "First negatine number: " << negative << endl;
}

