#include <stdio.h>

void printPattern(int value) {
    // Map numeric values to characters
    char characters[] = {' ', 'o', '\\', ':', '-', '\'', '\"', '.', '_', '(', ')', '^', '='};

    // Print the corresponding character
    printf("%c", characters[value]);
}

int main() {
    // Declare a file pointer
    FILE *file;

    // Open the file in read mode
    file = fopen("code.txt", "r");

    // Check if the file opened successfully
    if (file == NULL) {
        fprintf(stderr, "Error opening the file.\n");
        return 1; // Return an error code
    }

    // Read the 2D array from the file
    int image[9][16];
    for (int i = 0; i < 9; i++) {
        for (int j = 0; j < 16; j++) {
            fscanf(file, "%d", &image[i][j]);
        }
    }

    // Close the file
    fclose(file);

    // Iterate through the rows and columns of the array
    for (int i = 0; i < 9; i++) {
        for (int j = 0; j < 16; j++) {
            // Print the corresponding pattern for each value
            printPattern(image[i][j]);
            
        }
        // Move to the next line after each row is printed
        printf("\n");
    }

    return 0;
}

